import styles from "./Sidebar.module.scss";
import classNames from "classnames/bind";
import config from "../../../../config";

import Menu, { MenuItem } from "./Menu";
import {HomeIcon, GroupUserIcon, BigLiveIcons} from "../../../Icons"

const cx = classNames.bind(styles);

function Sidebar() {
  return (
    <aside className={cx("wapper")}>
      <Menu>
        <MenuItem title="For Your" to={config.routes.home} icon={<HomeIcon />} />
        <MenuItem title="Following" to={config.routes.following} icon={<GroupUserIcon />} />
        <MenuItem title="LIVE" to={config.routes.live} icon={<LiveIcon />} />
      </Menu>
    </aside>
  );
}

export default Sidebar;
